import './Tab1.css'
import Autocomplete from '@mui/material/Autocomplete';
import TextField from '@mui/material/TextField';
import FormControlLabel from '@mui/material/FormControlLabel';
import Checkbox from '@mui/material/Checkbox';
import Button from '@mui/material/Button';
import { DataGrid } from '@mui/x-data-grid';

export default function Tab1() {
  const main = ['Ranking 1','Ranking 2'];
  const add = ['Ranking 1', 'Ranking 2'];
  const states = ['State 1', 'State 2'];

  const columns = [
    { field: 'id', headerName: 'ID', width: 70 },
    { field: 'firstName', headerName: 'First name', width: 130 },
    { field: 'lastName', headerName: 'Last name', width: 130 },
    {
      field: 'age',
      headerName: 'Age',
      type: 'number',
      width: 90,
    },
    {
      field: 'fullName',
      headerName: 'Full name',
      description: 'This column has a value getter and is not sortable.',
      sortable: false,
      width: 160,
      valueGetter: (value, row) => `${row.firstName || ''} ${row.lastName || ''}`,
    },
  ];

  const rows = [
    { id: 1, lastName: 'Snow', firstName: 'Jon', age: 35 },
    { id: 2, lastName: 'Lannister', firstName: 'Cersei', age: 42 },
    { id: 3, lastName: 'Lannister', firstName: 'Jaime', age: 45 },
    { id: 4, lastName: 'Stark', firstName: 'Arya', age: 16 },
    { id: 5, lastName: 'Targaryen', firstName: 'Daenerys', age: null },
    { id: 6, lastName: 'Melisandre', firstName: null, age: 150 },
    { id: 7, lastName: 'Clifford', firstName: 'Ferrara', age: 44 },
    { id: 8, lastName: 'Frances', firstName: 'Rossini', age: 36 },
    { id: 9, lastName: 'Roxie', firstName: 'Harvey', age: 65 },
  ];

    return (
      <>
        <h1>Welcome to Tab 1.</h1> 
        <div className='box'>
          <div className ='ranking'>
            <div className='filter-header'>Select your Ranking</div>
            <Autocomplete
              disablePortal
              id="combo-box-demo"
              className='tab'
              options={main}
              sx={{ width: 550 }}
              renderInput={(params) => <TextField {...params} label="Choose Main Ranking" />}
            />
            <Autocomplete
              disablePortal
              id="combo-box-demo"
              className = 'tab'
              options={add}
              sx={{ width: 550 }}
              renderInput={(params) => <TextField {...params} label="Choose Additional Ranking (Optional)" />}
            />
            <br></br>
            <Button variant="contained"sx={{ width: 550 }}>Add</Button>
          </div>
          <div className ='filter'>
            <p className = 'filter-header'>Filter Options</p>
            <div>
              <div className='filter-header'>Setting</div>
              <FormControlLabel control={<Checkbox />} className = 'label' label="Urban" />
              <FormControlLabel control={<Checkbox />} className = 'label' label="Suburban" />
              <FormControlLabel control={<Checkbox />} className = 'label' label="Rural" />
            </div>
            <div>
              <div className='filter-header'>Private/Public</div>
              <FormControlLabel control={<Checkbox />} className = 'label' label="Private" />
              <FormControlLabel control={<Checkbox />} className = 'label' label="Public" />
            </div>
            <div>
              <div className ='filter-header'>Location</div>
              <Autocomplete
              disablePortal
              id="combo-box-demo"
              options={states}
              sx={{ width: 300 }}
              renderInput={(params) => <TextField {...params} label="States" />}
              />
            </div>
          </div>
        </div>
        <DataGrid
          rows={rows}
          columns={columns}
          initialState={{
            pagination: {
              paginationModel: { page: 0, pageSize: 5 },
            },
          }}
          pageSizeOptions={[5, 10]}
          checkboxSelection
        />
      </>
    );
}
